import styled from "styled-components";

export const Bubbly = styled.button`
  // background: #fb5f3b;
  background: none;
  // border-radius: 30px;
  border: none;
  // box-shadow: 0px 0px 8px 0px rgba(0,0,0,0.16);
  color: #fff;
  cursor: pointer;
  font-size: 12px;
  font-family: HindMRegular;
  line-height: 1.3;
  margin: 0 auto 40px;
  max-width: 400px;
  outline: none;
  padding: 13px 27px;
  position: relative;
  width: 100%;
  white-space: nowrap;
  transform: translateZ(0) translate(calc(-50% ), calc(-50%) );

  &:hover {
    color: #fff;
    font-weight: 700;

    &:after {
      background: #fb5f3b;
    }

    &:before {
      border-top-color: #fb5f3b;
    }
  }

  &:focus {
    font-weight: 700;

    &:after {
      background: #fb5f3b;
    }

    &:before {
      border-top-color: #fb5f3b;
    }
  }

  &:after {
    background: #fb5f3b;
    border-radius: 16px;
    bottom: 8px;
    box-shadow: 0px 0px 8px 0px rgba(0, 0, 0, 0.16);
    content: "";
    left: 8px;
    position: absolute;
    right: 8px;
    top: 8px;
    z-index: -1;
  }

  &:before {
    border: 10px solid transparent;
    border-top-color: #fb5f3b;
    bottom: -10px;
    content: "";
    height: 0;
    left: 50%;
    position: absolute;
    transform: translateX(-50%);
    width: 0;
  }
`;
